import React from 'react';
import './style.css'
import entradaIcon from '../assets/entrada.png';
import hojeIcon from '../assets/hoje.png';

function LateralBar(){
    return (
        <div className="lateral-bar">
            <div style={{float: "left"}}>
                <img src={entradaIcon} alt="Entrada" />
            </div>
            <div>
                <h3 className="texto-lateral"> Entrada</h3>
            </div>


            <br />
            <img src={hojeIcon} alt="Hoje" />
            <h3 className="texto-lateral"> Hoje</h3>
        </div>
    )
}
export default LateralBar;
